define PregnancyDiagnoses:
  C3F.Confirmed(
    C3F.ActiveOrRecurring(
      C3F.ConditionLookBack(
        [Condition: "Pregnancy"] union [Condition: "Pregnancy (New ICD10 codes published in 2018 and 2020)"],
        42 weeks
      )
    )
  )
